//
// Arguments    : const creal_T x[1995]
//                const double costab[1025]
//                const double sintab[1025]
//                creal_T y[2048]
// Return Type  : void
//
static void r2br_r2dit_trig(const creal_T x[1995], const double costab[1025],
                            const double sintab[1025], creal_T y[2048]) {
    int i;
    int ix;
    int ju;
    int iy;
    boolean_T tst;
    double temp_re;
    double temp_im;
    int iheight;
    int istart;
    int j;
    double twid_re;
    double twid_im;
    int ihi;
    for (i = 0; i < 2048; i++) {
        y[i].re = 0.0;
        y[i].im = 0.0;
    }

    ix = 0;
    ju = 0;
    iy = 0;
    for (i = 0; i < 1994; i++) {
        y[iy] = x[ix];
        iy = 2048;
        tst = true;
        while (tst) {
            iy >>= 1;
            ju ^= iy;
            tst = ((ju & iy) == 0);
        }

        iy = ju;
        ix++;
    }

    y[iy] = x[ix];
    for (i = 0; i <= 2047; i += 2) {
        temp_re = y[i + 1].re;
        temp_im = y[i + 1].im;
        y[i + 1].re = y[i].re - y[i + 1].re;
        y[i + 1].im = y[i].im - y[i + 1].im;
        y[i].re += temp_re;
        y[i].im += temp_im;
    }

    iy = 2;
    ix = 4;
    ju = 512;
    iheight = 2045;
    while (ju > 0) {
        for (i = 0; i < iheight; i += ix) {
            temp_re = y[i + iy].re;
            temp_im = y[i + iy].im;
            y[i + iy].re = y[i].re - temp_re;
            y[i + iy].im = y[i].im - temp_im;
            y[i].re += temp_re;
            y[i].im += temp_im;
        }

        istart = 1;
        for (j = ju; j < 1024; j += ju) {
            twid_re = costab[j];
            twid_im = sintab[j];
            i = istart;
            ihi = istart + iheight;
            while (i < ihi) {
                temp_re = twid_re * y[i + iy].re - twid_im * y[i + iy].im;
                temp_im = twid_re * y[i + iy].im + twid_im * y[i + iy].re;
                y[i + iy].re = y[i].re - temp_re;
                y[i + iy].im = y[i].im - temp_im;
                y[i].re += temp_re;
                y[i].im += temp_im;
                i += ix;
            }

            istart++;
        }

        ju /= 2;
        iy = ix;
        ix += ix;
        iheight -= iy;
    }
}

